import React from 'react';
import {Typography, Box} from '@mui/material';
import './home.css';
const Home = () => {
    return (
        <div>
            {/* Titre ou autre contenu si nécessaire */}
            <Typography variant="h4" align="center" sx={{color: 'white', fontWeight: 'bold', marginTop: '20px'}}>
                Welcome to tunisian Tournament : TIKTOK FOR ALL !
            </Typography>
            <div style={{textAlign: 'center', padding: '20px'}}>
                <Typography variant="h3" gutterBottom>Bienvenue au Tournoi</Typography>
                <Typography variant="h5">Sélectionnez une phase pour voir les groupes ou les éliminations
                    directes.</Typography>
            </div>
            <div className="group-stage-container">
                {/* Section pour l'affiche du tournoi */}
                <Box sx={{display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh'}}>
                    <img src="/images/tournoi.png" alt="Affiche du Tournoi" className="tournoi-image"/>
                </Box>


            </div>
        </div>
    )
};

export default Home;
